import React from 'react';

const ImageLinkForm = () => {
	return (
		<div className= 'f3'>
			<p>{'This Magic Can Detect Your Face, give it a try'}</p>
			<div>
			<input type= 'text'/>
			<button>Detect</button>
			</div>
		</div>
	)
}

export default ImageLinkForm;
